import './Estante.css'

function Estante(props){
 var c = props.conteudo;
 heightRedimencionado = window.innerHeight/ 2;
 var localX = window.innerHeight;
 var localY = window.innerWidth;
 var tamanhoW = window.innerwidth
 var tamanhoH = window.innerheight;
if(props.escolhido){
  
  return(
    <div className='EstanteEscolhida' key={props.i} style={{left: c.x, top: c.y, rotate: c.rotate+"deg", height: c.height, width: c.width}}>
    </div>  
  )
}else{
  return(

    <div className='Estante' key={props.i} style={{left: c.x, top: c.y, rotate: c.rotate+"deg", height: c.height, width: c.width}}>
    </div>  
  )
}
 
}
export default Estante
